import styled from 'styled-components';

export const MenuTitleContainer = styled.h1`
    font-weight: bold;
    margin-bottom: 6px;
    font-size: 22px;
    color: #4a4a4a;
`; 

export const MenuSubtitleContainer = styled.span`
    font-weight: lighter;
    font-size: 16px;
`;
